// 下载图片函数
function downloadImage(url, destPath) {
  return new Promise((resolve, reject) => {
    const file = fs.createWriteStream(destPath);
    https
      .get(url, response => {
        if (response.statusCode === 200) {
          response.pipe(file);
          file.on('finish', () => {
            file.close(resolve(url)); // 成功下载图片，返回图片地址
          });
        } else {
          file.close(() => {
            fs.unlink(destPath, () => {}); // 删除空文件
            reject(new Error(`Failed to download ${url}. Status code: ${response.statusCode}`)); // 下载失败
          });
        }
      })
      .on('error', err => {
        fs.unlink(destPath, () => {}); // 删除空文件
        reject(err); // 下载出错
      });
  });
}

// 批量下载函数
async function batchDownloadImages(urls) {
  const downloadPromises = [];

  for (const url of urls) {
    const destPath = path.basename(url); // 使用图片地址的文件名作为本地文件名
    const parentDir = path.basename(path.dirname(url));
    // 创建目录（如果不存在）
    if (!fs.existsSync(parentDir)) {
      fs.mkdirSync(parentDir, { recursive: true });
    }
    try {
      await downloadImage(url, path.join(parentDir, destPath));
      console.log(`Downloaded: ${url}`);
    } catch (error) {
      console.error(`Error downloading ${url}: ${error.message}`);
    }
  }
}

